func buddyStrings(A string, B string) bool {
	isBuddy := false
	aLen := len(A)
	bLen := len(B)
	if bLen == aLen && aLen > 0 {
		for i := 0; i < aLen; i++ {
			c1 := A[i : i+1]
			for j := i + 1; j < aLen; j++ {
				c2 := A[j : j+1]
				if c1 == c2 {
					if A == B {
						isBuddy = true
					}
					continue
				}
				A1 := ""
				if i < j {
					A1 = A[:i] + c2
					if i <= aLen-1 && i+1 <= j {
						A1 += A[i+1 : j]
					}
					A1 += c1
					//if j < aLen - 1 {}
					if j < aLen-1 {
						A1 += A[j+1:]
					}
				} else {
					A1 = A[:j] + c2
					if j <= aLen-1 && j+1 <= i {
						A1 += A[j+1 : i]
					}
					A1 += c1
					//if j < aLen - 1 {}
					if i < aLen-1 {
						A1 += A[i+1:]
					}
				}
				//fmt.Println(A1, i, j, c1, c2)
				if A == A1 {
					continue
				}
				if A1 == B {
					isBuddy = true
					break
				}
			}
			if isBuddy {
				break
			}
		}
	}

	return isBuddy
}
